    nativeSelectors: 'eyJ0YWJvb2xhIjoiLnRyY19zcG90bGlnaHRfaXRlbSIsIm91dGJyYWluIjoiLm9iLWR5bmFtaWMtcmVjLWNvbnRhaW5lciIsInZtIjoiLnJlYWRtby1pdGVtLWxpbmsiLCJnZW1pbmkiOiJbaWRePVwiZ2VtaW5pXCJdIiwicmV2Y29udGVudCI6IltpZF49XCJyY19jb250XCJdIC5yYy1pdGVtIiwibmF0aXZvIjoiW2lkXj1cIm50dlwiXS5ub3NraW0iLCJjb3JkbGVzcyI6ImFbY21kYXRhLWFkaWRdLC5jbUFkZGl0aW9uYWxTZXJ2aWNlc0NhcmQiLCJjb250ZW50ZXhjaGFuZ2UiOiJkaXZbZGF0YS1jb250ZW50ZXhjaGFuZ2Utd2lkZ2V0XSBkaXYuXFwkYmV4QWRfcG9zdCJ9',
    nativePassback: 'undefined',
    isNS: 'false' === 'true',
    nsSample: '1',
    ieBatchProcessingTimeout: 'undefined',
    cnstSample: 0.001,
    isPIMG: 'true' === 'true',
    prebidCustomizeBid: clientSettings.prebidCustomizeBid,
    send_amazon_bidder: 'false' === 'true',
    isGE: 'undefined' === 'true',
    isPDS: 'undefined' === 'true',
    isExtPlcmtInDiv: 'undefined' === 'true',
    consentXFSamplingRate: '1',
    vsSample: '0',
    isMGBL: clientSettings.isMGBL || false,
    gppRate: '0' !== 'undefined' ? parseFloat('0') : 0,
    adReporterConfig: adReporterConfig,
    vsPropertyId: 'none',
    vsSites: '',
    pbjsSelectors: '',
    encType: 'undefined' !== 'undefined' ? 'undefined' : '',

    vsTSample: 'undefined' !== 'undefined' ? parseFloat('undefined') : 0.01,

  };

  var scriptId = !!confiantGlobal.settings ? settings.propertyId : null;
  if(confiantGlobal && confiantGlobal.settings && confiantGlobal.settings.propertyId === scriptId
      && integrationSetting.integration_type !== 'native') {
    return;
  }
  var propertySettings = scriptId ? confiantGlobal[scriptId] || (confiantGlobal[scriptId] = {}) : confiantGlobal;
  propertySettings.settings = settings;
  propertySettings.settings['gpt_and_prebid'] = integrationSetting;
  function injectScript(path, idOverride) {
    var e = document.createElement('script');
    e.onload = initConfiantQueue;
    e.onerror = initConfiantQueue;
    if (scriptId || idOverride) {
      e.id = scriptId || idOverride;
    }
    e.async = true;
    e.src = path;
    var s = document.getElementsByTagName('script')[0];
    s.parentNode.insertBefore(e, s);
  }
  var integrationsCounter = 0;

  function isIntegrationEnabled(type) {
    var integrations = propertySettings.settings.enable_integrations;
    var checkType = Array.isArray(integrations) ? type : type + ':true';
    return (integrations && integrations.indexOf(checkType) > -1);
  }

  var isVideoPropertySame = settings.vsPropertyId === settings.propertyId;
  settings.isVS = isVideoEnabled() && isVideoPropertySame;
  var integrationsString = settings.isVS ? 'gptprebidnativevideo' : 'gptprebidnative';
  integrationsCounter++;
  var shouldUseTestVer = !!integrationSetting.exec_test_ver && (Math.random() < integrationSetting.exec_test_rate);
  var versionToUse = shouldUseTestVer
      ? integrationSetting.exec_test_ver
      : integrationSetting.integration_version;
  injectScript('//' + [propertySettings.settings.confiantCdn, integrationsString, versionToUse, 'wrap.js'].join('/'));

  if (isVideoEnabled()) {
    if (!isVideoPropertySame){
      integrationsCounter++;
      injectScript('//' + [propertySettings.settings.confiantCdn, settings.vsPropertyId, 'video', 'config.js'].join('/'), settings.vsPropertyId);
    }
  }

  if (
    !isIntegrationEnabled('gpt')
    && !isIntegrationEnabled('prebid')
    && !isIntegrationEnabled('native')
    && !isIntegrationEnabled('video')
  ) {
    console.warn('Confiant', 'Current configuration is set not to monitor, please contact support@confiant.com');
  }

  function isVideoEnabled() {
    if (!(Math.random() <= settings.vsSample)) {
      return false;
    }

    if (settings.vsSites.length === 0) {
      console.warn('Confiant: No sites are configured for video scanning');
      return false;
    } else if (settings.vsSites === '*') {
      return true;
    }

    var found = settings.vsSites.split(',').some(function(site) {
      return document.location.toString().indexOf(site) > -1;
    });

    if (!found) {
      console.log('Confiant video test: disabled for this page');
      return false;
    } else {
      return true;
    }
  }

  function initConfiantQueue() {
    integrationsCounter--;
    if (integrationsCounter === 0) {
      confiantGlobal.cmd = confiantGlobal.cmd || [];
      for (var i = 0; i < confiantGlobal.cmd.length; i++) {
        try {
          confiantGlobal.cmd[i].call(null);
        } catch (e) {}
      }
      confiantGlobal.cmd = {};
      confiantGlobal.cmd.push = function(funcToExec) {
        funcToExec.call(null);
      };
    }
  }
})();
